import React from 'react'
import "../css/Header.css"
// import img2 from "../images/college_photo_2.jpg"
// import img3 from "../images/college_photo_3.jpg"
// import img4 from "../images/college_photo_4.jpg"



const Header = () => {
    return (
        <>
            {/* header start */}
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid">
                    {/* <a className="navbar-brand" href="#"></a> */}
                    {/* <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button> */}
                    <img class="" src="https://www.salesian.vic.edu.au/app/themes/sallesian-college/dist/images/logo.png" alt="Salesian College" />

                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <a className="nav-link" href="#">ENROLL NOW</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#">BOOK A TOUR</a>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
            {/* header end */}
        </>
    )
}

export default Header
